import React from "react";
import styled from "styled-components";
import colors from "../../theme/main/colors";

const AgreementContainer = styled("div")`
margin-bottom:40px;
display:flex;
justify-content:start;
text-align:start;
}
`;

const CheckBoxLabel = styled("label")`
font-family: Open Sans;
font-style: normal;
font-weight: normal;
font-size: 12px;
line-height: 16px;
color: #444444;
padding-left:10px;
}
`;

const LinkWithLine = styled("a")`
color:${colors.primary};
padding-left:5px;
font-family: Open Sans;
font-style: normal;
font-weight: normal;
font-size: 12px;
line-height: 16px;
text-decoration-line: underline;

/* Taxiye/Purple/Main */

color: #A02167;

}
`;

const Terms = () => {
    return (
        <>
            <AgreementContainer>
                <div>
                    <input type="checkbox" id="terms" name="interest" value="coding" />
                    <CheckBoxLabel>I agree to Taxiye's</CheckBoxLabel>
                </div>
                <div>
                <LinkWithLine href="/">Terms of service</LinkWithLine>
                </div>
            </AgreementContainer>
        </>
    );
}


export default Terms;
